INSERT INTO `campus` (`id`, `building_name`, `address`, `description`, `link`, `lat`, `lon`, `open`, `department`, `num_thumbs`, `flickr_photoset`, `online`)
VALUES
	(1,'Pierpont Commons','2101 Bonisteel Blvd.<br />Ann Arbor, MI 48109','The ultimate North Campus hangout zone... visit the CAEN computer labs, make some music in the piano lounge, take a breath in the reflection room or stop by the Information Center. Also a hotspot for eating and shopping, featuring a Barnes & Noble, Beanster\'s Cafe, Panda Express and more.',NULL,'42.29102214117964','-83.71757093307951',0,NULL,7,'72157630304424316',1),
	(2,'North Campus Research Complex (NCRC)',NULL,NULL,NULL,'42.300440588654055','-83.70596233246306',0,NULL,7,'72157630530703532',0),
	(3,'James and Anne Duderstadt Center','2281 Bonisteel Blvd.<br />Ann Arbor, MI 48109','Home of Mujo Cafe, a great place to sit down between classes and grab a snack or drink with friends. Or take a spin around the Digital Media Commons, virtual reality labs or video game archives.',NULL,'42.29114416493493','-83.71573630211333',0,NULL,7,'72157630317967162',1),
	(4,'Walter E. Lay Automotive Laboratory','1231 Beal Ave.<br />Ann Arbor, MI 48109','All of your automotive and mechanical engineering needs are met. Take advantage of labs to research diesel engines, metal matrices, mechatronics, low engine friction and more. Graduate student research assistants are here to help you out and answer any questions that come up.',NULL,'42.29188572698258','-83.71368709442595',0,'Mechanical Engineering',7,'72157630304622346',1),
	(5,'Environmental & Water Research Engineering','1351 Beal Ave.<br />Ann Arbor, MI 48109','Contains offices and research areas for research in environmentally-related areas such as water quality, watersheds, hazardous substances and microbiology.',NULL,'42.29278402222122','-83.71342155573348',0,'Civil and Environmental Engineering',7,'72157630303333944',1),
	(6,'Mortimer E. Cooley Building','2355 Bonisteel Blvd.<br />Ann Arbor, MI 48109','Relax in a student lounge or get some work done in a CAEN lab after one of your in-house classes. Or, do research in one of the nuclear reactor or radiology testing labs, where you can try your hand and test a new theory or experiment.',NULL,'42.29061241741044','-83.71365490791777',0,'Nuclear Engineering & Radiological Sciences',7,'72157630303172974',1),
	(7,'Electrical Engineering and Computer Science Building','1301 Beal Ave.<br />Ann Arbor, MI 48109','Visit the Robert H. Lurie Nanofabrication Facility, which utilizes state-of-the-art nanotechnology, or get some work done in the CAEN lab, which is specifically devoted to the use of Engineering students and is open 24 hours a day.',NULL,'42.2925260922653','-83.71396872637251',0,'Electrical Engineering & Computer Science',7,'72157630303192154',1),
	(8,'Lurie Nanofabrication Facility',NULL,NULL,NULL,'42.29219524594982','-83.71319356796721',0,NULL,7,'72157630621129528',0),
	(9,'Engineering Research Building I & II','2200 Bonisteel Blvd.<br />Ann Arbor, MI 48109','Site of the Institute of Environmental Sciences, Engineering and Technology, and contains several labs devoted to material science and green technology research -- including inorganic radio chemistry and potable water. Also houses the Minority Engineering Programs and the Center for Ultrafast Optical Science.',NULL,'42.28951716209543','-83.71532860634306',0,'Civil and Environmental Engineering',7,'72157630303297312',1),
	(10,'Gorguze Family Laboratory','2609 Draper<br />Ann Arbor, MI 48109','If you\'re ever in need of a wind tunnel, plasma research lab or the Wilson Student Team Project Center, stop on by. Or, just walk past and take a look at the building\'s painted dome called \"The Order of the Spheres.\"',NULL,'42.29364411178662','-83.7108868682144',0,'Aerospace Engineering',7,'72157630303465336',1),
	(11,'Francois-Xavier Bagnoud Building','1320 Beal Ave.<br />Ann Arbor, MI 48109','Walk past a real airplane and various airplane parts in the lobby on your way to research at the museum-like Aero Media Center. Or head out back to the famous soft grass of the wave field, designed by Maya Lin, who designed the Vietnam Veterans Memorial in Washington DC; the waves are perfectly designed for an afternoon nap in the sun.',NULL,'42.293612367051786','-83.71203485367278',0,'Aerospace Engineering',7,'72157630303417726',1),
	(12,'G.G. Brown Laboratories','2350 Hayward St.<br />Ann Arbor, MI 48109','A plethora of laboratories are available, including the Vibrations and Acoustics Lab, Fluorescence Microscopy Imaging Lab, High Temperature Creep Lab, Quantitive Laser Diagnostics Lab and Lab for Turbulence Physics. The lab also houses learning services like the Center for Innovation, Finley and MEAM Learning Centers, Pi Tau Sigma and Unified Minority Mechanical Engineers.',NULL,'42.293088576617016','-83.71400895950774',0,NULL,7,'72157630303458596',1),
	(13,'Chrysler Center','2121 Bonisteel Blvd.<br />Ann Arbor, MI 48109','Your one-stop shop for student support services. Home to academic advising, the Office of Student Affairs, the Admissions Office, Center for Entrepreneurship, Center for Diversity and Outreach, international, career and professional development centers.',NULL,'42.290771148484794','-83.71670189735869',0,NULL,7,'72157630301578800',1),
	(14,'Bob and Betty Beyster Building','2250 Hayward St.<br />Ann Arbor, MI 48109','Offers computing labs, conference rooms and student project space, as well as classrooms and faculty offices. Also, check out the cool spiral staircase&mdash;trust us, you\'ll like it.',NULL,'42.292760213346455','-83.7165946089981',0,'Electrical Engineering & Computer Science',7,'72157630301585870',1),
	(15,'Bonisteel Interdisciplinary Research Building','2360 Bonisteel Blvd.<br />Ann Arbor, MI 48109\r','Providing multiple resources for engineering students. Need an MRI for research? Stop on by to the Functional MRI Laboratory!',NULL,'42.2898901859717','-83.71349397537688',0,NULL,7,'72157630301594704',1),
	(16,'Carl A. Gerstacker Building','2200 Bonisteel Blvd.<br />Ann Arbor, MI 48109','Features 5,000 square feet of research space -- including the Bio-fluid Mechanics Laboratory, which is developing an artificial lung -- and also provides access to high tech ultrasonic imaging, nano and micro molecular biotechnology. ',NULL,'42.2896203391333','-83.71451321480254',0,NULL,7,'72157630301600250',1),
	(17,'Phoenix Memorial Laboratory','2301 Bonisteel Blvd.<br />Ann Arbor, MI 48109','Home of the Michigan Memorial Phoenix Project and its Ford Nuclear Reactor, designed to investigate peaceful uses for nuclear power.',NULL,'42.29101668482863','-83.71470096943358',0,NULL,7,'72157630299365224',1),
	(18,'School of Information North','1075 Beal Ave.<br />Ann Arbor, MI 48109','Home of the finance team, School of Information (North), research on electronic work. and the Marketing & Communications department.',NULL,'42.28900425065875','-83.71444884178618',0,NULL,7,'72157630286731686',1),
	(19,'Ann + Robert Lurie Biomedical Engineering Building','1101 Beal Ave.<br />Ann Arbor, MI 48109','A great place to work on a class project, with wet labs, dry labs and shared labs all available for use. It\'s also a great place to see beautiful, sleek architecture; grab a picnic table or sit on the grass outside and read a book on a sunny day!',NULL,'42.28896159052512','-83.713515433049',0,'Biomedical Engineering',7,'72157630299283394',1),
	(20,'Robert H. Lurie Engineering Center','1221 Beal Ave.<br />Ann Arbor, MI 48109','Come by to visit the Academic Affairs offices, or use one of the many student lounges. Just outside is the gorgeous North Campus fountain, a perfect place to meet friends or get some homework done in a scenic setting.',NULL,'42.29147749691493','-83.71381584045866',0,NULL,10,'72157630286940478',1),
	(21,'Herbert H. Dow Building','2300 Hayward St.<br />Ann Arbor, MI 48109','Come by to the student and women\'s lounges to take a load off and read a book, or stop by the Graduate Student Office for an advising appointment. Houses specialized, state-of-the-art analytical reaction, ceramics, x-ray defraction, furnace, spectroscopy and syn rod analysis labs.',NULL,'42.29281874348085','-83.71561828491667',0,'Chemical Engineering',7,'72157630286678854',1),
	(22,'Industrial & Operations Engineering Building','1205 Beal Ave.<br />Ann Arbor, MI 48109','Stop by the ergonomics safety lab, upper extremity cumulative trauma disorders lab, or the decision analysis and simulation lab to do some research. If you need a graduate student instructor, they can be found here, or you can hang out in the IOE commons or do some work in the photography dark room.',NULL,'42.29106479991777','-83.71383729813078',0,'Industrial and Operations Engineering',7,'72157630938670980',1),
	(23,'Naval Architecture & Marine Engineering','1600 Draper<br />Ann Arbor, MI 48109','Home of administration and faculty offices for Naval Architecture & Marine Engineering, as well as student services. An undergraduate design lab and radiation lab is also available to use.',NULL,'42.2930245905563','-83.7095886790512',0,'Naval Architecture & Marine Engineering',7,'72157630938671026',1),
	(24,'Space Research Building','2455 Hayward St.<br />Ann Arbor, MI 48109','Take in an event at the auditorium or hold a meeting in the videoconference room. Use the electron microbeam analysis lab or the space physics research lab for your work.',NULL,'42.294353900039674','-83.71153059837798',0,'Atmospheric, Ocean and Space Sciences',7,'72157630937873472',1),
	(25,'West Hall','1085 S. University Ave.<br />Ann Arbor, MI 48109','The Marine Hydrodynamic Laboratory is located in the heart of Central Campus, right by the entrance to the Diag and downtown Ann Arbor. All of the testing you might need to perform on a remote operated vehicle is available: resistance, seakeeping, propeller and physical modeling, with 3D time-of-flight cameras.',NULL,'42.275671552770405','-83.73620155689696',0,'Naval Architecture and Marine Engineering',7,NULL,0),
	(26,'Lurie Bell Tower',NULL,NULL,NULL,'42.291935825507075','-83.7163612568138',0,NULL,7,'72157630937586434',0);
