INSERT INTO `difference` (`id`, `image1`, `hires`, `name`, `city`, `state`, `country`, `email`, `title`, `story`, `under18`, `color`)
VALUES
	(1,'http://farm8.staticflickr.com/7117/7455359906_5f68819ebe_z.jpg','http://farm8.staticflickr.com/7117/7455359906_5f68819ebe_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'VJ Tocco ','Undergraduate student VJ Tocco works in a lab operated by Phil Savage, an Arthur F Thurnau Professor of Chemical Engineering. Savage and his group are trying to improve the process of converting algae and other biomass into liquid and gaseous fuels. In other words, they\'re trying to improve what nature does when it creates oil, but they don\'t want to wait millions of years. In understanding and improving this process, they\'re uncovering a way to produce affordable biofuels that could replace fossil fuels, power today\'s engines and shore up the world\'s economy.',NULL,'#007679'),
	(2,'http://farm8.staticflickr.com/7234/7204501206_4d999507ef_z.jpg','http://farm8.staticflickr.com/7234/7204501206_4d999507ef_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Theodore Hall','Advanced Visualization Specialist Theodore Hall (M.Arch \'81, Arch.D \'94) speaks about the Michigan Immersive Digital Experience Nexus (MIDEN) in the James and Anne Duderstadt Center\'s Virtual Reality Laboratory. MIDEN, currently the most advanced system for immersive virtual reality, is a superb tool for the visualization of complex environments.',NULL,'#007679'),
	(3,'http://farm9.staticflickr.com/8460/7943618040_385f6301d1_z.jpg','http://farm9.staticflickr.com/8460/7943618040_385f6301d1_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Tapping the Sun','Quantum, the eleventh solar car developed during the 22-year history of the U-M Solar Car Team, attracted a small crowd at the October 19 stop in Alice Springs during the 2011 World Solar Challenge across 1,800 miles of rugged Australian terrain. Quantum is a high-profile example of an evolving technology that taps the seemingly inexhaustible power of the sun.',NULL,'#007679'),
	(4,'https://sphotos-b.xx.fbcdn.net/hphotos-snc6/165901_10151082506888324_1290709695_n.jpg','https://sphotos-b.xx.fbcdn.net/hphotos-snc6/165901_10151082506888324_1290709695_n.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Jessica Jones','Aerospace Engineering doctoral student Jessica Jones discusses a model-airplane construction with Aerospace Engineering Professor Carlos Cesnik. Examination on the small-scale yields significant insights into structure and performance issues on the large-scale.',NULL,'#007679'),
	(5,'http://www.engin.umich.edu/students/prospective/graduate-profile-folder/alumni-profile-image-collection/eric-gustafson-interior-small','http://www.engin.umich.edu/students/prospective/life-at-michigan/the-people-1/graduate-profile-folder/alumni-profile-image-collection/eric-gustafson-interior-small','Ben Collins',NULL,NULL,NULL,NULL,'Eric Gustafson','Eric Gustafson (MSE AERO \'06, PhD \'10), a Navigation Engineer at NASA\'s Jet Propulsion Laboratory, helped steer the Mars rover Curiosity to its landing in Gale Crater, about 1.5 miles from its target after a 350-million-mile journey. ',NULL,'#007679'),
	(6,'http://www.engin.umich.edu/newscenter/feature-story-photos-repository/mertifulstudentdemo2story.jpg','http://www.engin.umich.edu/newscenter/feature-story-photos-repository/meritful-school-demo/@@download/print_image/mertiful-student-demo-2-hires.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Azarias Reda','Azarias Reda (BSE CSE \'09, MSE \'12) is launching Meritful, a new online social networking platform that gives high school students a way to generate content that\'s helpful to them. Reda foresees a number of beneficial scenarios, such as one in which Meriful connects potential engineers with Michigan Engineering, or another in which Meritful becomes a channel through with students with existing ties to the University can receive direct feedback from faculty.',NULL,'#007679'),
	(7,'http://farm9.staticflickr.com/8016/7656942502_3ce1c94588_z.jpg','http://farm9.staticflickr.com/8016/7656942502_3ce1c94588_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Amelia Atkinson','Students in EECS481 use the Microsoft Kinect platform to demonstrate and present their final projects. Here, Computer Science student Amelia Atkinson uses her hands to operate and showcase her team\'s TicTacToe game designed for kids with autism.',NULL,'#007679'),
	(8,'http://farm9.staticflickr.com/8163/7605133734_bab8016ed5_z.jpg','http://farm9.staticflickr.com/8163/7605133734_bab8016ed5_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Paul Kaminski','U-M lecturer Paul Kaminski teaches Crossing the Boundaries, a summer class that\'s part of the Michigan Science, Technology, Engineering and Mathematics (M-STEM) Academy for incoming freshmen. ',NULL,'#007679'),
	(9,'http://farm9.staticflickr.com/8169/7939029760_05dbe0604e_z.jpg','http://farm9.staticflickr.com/8169/7939029760_05dbe0604e_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Jeremy Koehler ','Local nurse Angela Rosales talks to Jeremy Koehler about her work at a public health clinic in the village of Santa Cruz on Lake Atitlan in Guatemala. Koehler, a Mechanical Engineering graduate student, was there as a member of M-HEAL, a U-M student organization that develops sustainable solutions to healthcare challenges in low-resource settings. This particular clinic was in a dire need of even the most basic medicine like Tylenol.',NULL,'#007679'),
	(10,'http://farm9.staticflickr.com/8040/7939259536_a1bf8b4c84_z.jpg','http://farm9.staticflickr.com/8040/7939259536_a1bf8b4c84_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'BLUElab','BLUElab at U-M is a student-run organization that works toward sustainable solutions to development problems at home and abroad.  Undergrad engineering student Sita Syal (right) and Ben Barrie (XX XX XX) of the Appropriate Technology Collaborative were part of the BLUElab group that tackled the Woven Wind Turbine project in a Guatemalan village of Nueva Santa Catarina Ixtahuacan. U-M students designed a wind turbine with blades that are covered with material woven by Guatemalan women. The students hope that the local women will use their weaving skills to generate income and electricity. ',NULL,'#007679'),
	(11,'http://farm9.staticflickr.com/8288/7515925516_226be030e9_z.jpg','http://farm9.staticflickr.com/8288/7515925516_226be030e9_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Mohammed Islam','Mohammed Islam, a professor of Electrical Engineering and Computer Science, as well as Biomedical Engineering and Internal Medicine, conducts wide-ranging research. Perhaps the most dramatic is his work on laser sources and their applications, such as protecting aircraft against heat-seeking missiles; detecting substances such as explosives; treating hypertension and atrial fibrillation; and the non-invasive identification of blood constituents.',NULL,'#007679'),
	(13,'http://farm8.staticflickr.com/7226/7296040210_e21c0436f6_z.jpg','http://farm8.staticflickr.com/7226/7296040210_e21c0436f6_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Quadrotor','Undergraduate Noah Katzman, Graduate Student Research Assistant Stephan Chaves, graduate student Ryan Wolcott, and Graduate Student Research Assistant Nick Carlevaris-Bianco test an autonomous quadrotor in the Fran√ßois-Xavier Bagnoud Building on North Campus. The quadrotor, using its on-board camera, locates a moving Segway and lands on it without human guidance, simulating the landing of an autonomous aircraft on the deck of an aircraft carrier moving at sea.',NULL,'#007679'),
	(15,'http://farm9.staticflickr.com/8170/8044170254_a3d1cc1d00_z.jpg','http://farm9.staticflickr.com/8170/8044170254_a3d1cc1d00_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'James Paul Holloway','James Paul Holloway, Arthur F Thurnau Professor of Nuclear Engineering and Radiological Sciences and associate dean for undergraduate education, captivated students, staff and faculty who attended a Fireside Chat. The International Program in Engineering conducted the Chat, which introduced students to the different perspectives and opportunities that studying abroad offers.',NULL,'#007679'),
	(16,'http://farm8.staticflickr.com/7112/7420317152_56ba61323c_z.jpg','http://farm8.staticflickr.com/7112/7420317152_56ba61323c_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'David Fick','EECS Graduate Student David Fick (BSE CSE \'06, MSE \'09, PhD \'12) works on a variety of integrated circuits (&quot;chips&quot;), from the very large to the very small. On the large side, energy-efficient processors enhance the performance of datacenters and super computers and, in the process, improve a broad range of activities such as hosting websites and conducting medical research. On the other end of the spectrum, small chips enable tiny systems to do long-term monitoring of the environment and infrastructure (such as bridges that might need repair), and even in the human eye, measuring internal pressure for glaucoma. The potential applications are mind-boggling.',NULL,'#007679'),
	(17,'http://farm8.staticflickr.com/7081/7176673210_4de4485264_z.jpg','http://farm8.staticflickr.com/7081/7176673210_4de4485264_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Space-Filling','Research Scientist Joshua Anderson (left) and Sharon Glotzer, the Stuart W Churchill Collegiate Professor of Chemical Engineering and a professor of Materials Science and Engineering, visualize an aspect of the &quot;filling problem&quot;: what is the best way to cover the inside of an object with a particular shape, such as filling a triangle with discs of varying sizes. Glotzer and her team introduced the problem and provided a solution in two dimensions. Their space-filling solution could improve cancer treatment, make wireless networks more secure, and accelerate the production of silicon chips.',NULL,'#007679'),
	(18,'http://farm9.staticflickr.com/8330/8116832174_8553c1de12_z.jpg','http://farm9.staticflickr.com/8330/8116832174_8553c1de12_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Hannah Cheriyan','Hannah Cheriyan, Biomedical Engineering yndergraduate, draws a model of a manually-powered portable centrifuge. She\'s part of Centricycle, a group of student entrepeneurs working with the TechArb in Ann Arbor, Michigan, to bring this technology to underprivileged rural areas in countries such as India.',NULL,'#007679'),
	(19,'http://farm8.staticflickr.com/7098/7153678429_c11a40f244_z.jpg','http://farm8.staticflickr.com/7098/7153678429_c11a40f244_b.jpg','Ben Collins',NULL,NULL,NULL,NULL,'Supermileage','Can a car really get 3,300 miles to the gallon? Laura Pillari and Robert Ognjanosvski are members of the U-M Supermileage Team, which is working to beat the North American record of 3,169 miles per gallon. Here they\'re creating half of the fiberglass mold needed to construct their single-passenger vehicle that they will better the record by reaching 3,300 mpg.',NULL,'#007679'),
	(20,'https://sphotos-a.xx.fbcdn.net/hphotos-prn1/68081_10151504905363761_2039341190_n.jpg','https://sphotos-a.xx.fbcdn.net/hphotos-prn1/68081_10151504905363761_2039341190_n.jpg','Brieland Garrett ',NULL,NULL,NULL,NULL,'EHELD','Through the Excellence in Higher Education for Liberian Development (EHELD) project, College of Engineering, the African Studies Center and the Women in Science and Engineering have been playing an important role in rebuilding Liberia\'s universities and infrastructure after 15 years of civil war. Through visiting professorships, graduate student fellowships, summer programs for Liberian youth and other endeavors, members of the U-M community are contributing to the revitalization of the nation. Here, Michigan Engineering students work alongside Liberian students to develop a local farm.',NULL,NULL),
	(21,'https://sphotos-a.xx.fbcdn.net/hphotos-prn1/66271_10151504891798761_1617021956_n.jpg','https://sphotos-a.xx.fbcdn.net/hphotos-prn1/66271_10151504891798761_1617021956_n.jpg',NULL,NULL,NULL,NULL,NULL,'Wind Turbine','Two things stand out in remote areas of Guatemala: electric power is scarce and women are expert weavers. A Michigan Engineering student team used those two facts as a basis for a project in which they designed and installed wind turbines powerful enough to drive small electric generators to produce clean, emissions-free power &mdash; green energy is popular even in rural Guatemala.',NULL,NULL),
	(22,'https://sphotos-a.xx.fbcdn.net/hphotos-snc7/3715_10151505009908761_322910842_n.jpg','https://sphotos-a.xx.fbcdn.net/hphotos-snc7/3715_10151505009908761_322910842_n.jpg',NULL,NULL,NULL,NULL,NULL,'Melissa Boelstler','Melissa Christine Boelstler is a Michigan Engineering undergraduate student who works at St. Paul\'s Primary school in Capetown, South Africa, demonstrating that character, not just education, is essential to making a difference in the world.',NULL,NULL),
	(23,'http://farm8.staticflickr.com/7106/7496440354_f65580be89_z.jpg','http://farm8.staticflickr.com/7106/7496440354_f65580be89_b.jpg',NULL,NULL,NULL,NULL,NULL,'Mina Rais-Zadeh','Mechanical Engineering Assistant Professor Mina Rais-Zadeh (back center) watches members of her Resonant MEMS Group as they concentrate on one of several MEMS-related research projects. Left to right: graduate student research assistants Zhengzheng Wu, Azadeh Ansari and Yonghyun Shim; Mina Rais-Zadeh; and Gwendolyn Hummel, an electrical engineering student at the Illinois Institute of Technology in Chicago, Illinois.',NULL,NULL),
	(24,'http://farm8.staticflickr.com/7277/7456496288_01b4f47305_z.jpg','http://farm8.staticflickr.com/7277/7456496288_01b4f47305_b.jpg',NULL,NULL,NULL,NULL,NULL,'Mingyan Liu','Electrical Engineering and Computer Science Professor Mingyan Liu (center) works with graduate students Yang Liu (left) and Qingsi Wang (right) to develop a new concept for a smart wireless-sensor web technology that measures and collects data on levels of moisture in the soil. Measurements of soil moisture are critical in many physical models, including water and energy balance, weather prediction and ecosystem process simulation.',NULL,NULL),
	(25,'http://farm8.staticflickr.com/7280/7516310934_a60b8805b7_z.jpg','http://farm8.staticflickr.com/7280/7516310934_a60b8805b7_b.jpg',NULL,NULL,NULL,NULL,NULL,'Steve Forrest','Steve Forrest\'s research delves into phenomena related to electronic materials and optics, as well as the basic physics of new semiconductor and organic materials. His many breakthroughs include a printing process for depositing OLED materials. The process could simplify the manufacture of OLEDs for displays and lighting, which could also reduce costs. The process also could pattern a 60-inch OLED television display in 25 seconds. Steve Forrest is the William Gould Dow Collegiate Professor of Electrical Engineering, vice president for research, and a professor of materials science and physics.',NULL,NULL),
	(26,'http://farm9.staticflickr.com/8006/7695900170_ab7f281abe_z.jpg','http://farm9.staticflickr.com/8006/7695900170_ab7f281abe_b.jpg',NULL,NULL,NULL,NULL,NULL,'Nina Lin','Nina Lin (left), an assistant professor in the Department of Chemical Engineering, is developing a one-step &quot;consolidated&quot; bioprocessing, a potential breakthrough technology that can lead to large-scale and cost-effective production of liquid biofuels from lignocellulosic biomass. This breakthrough can significantly reduce our dependence on foreign oil, create new jobs, improve rural economies, reduce greenhouse gas emissions and improve national security. Elisa Cauley (right) is a chemical engineering undergrad and a member of Lin\'s research group.',NULL,NULL),
	(27,'http://farm9.staticflickr.com/8451/7951408624_43bb89c995_z.jpg','http://farm9.staticflickr.com/8451/7951408624_43bb89c995_b.jpg',NULL,NULL,NULL,NULL,NULL,'Allen Liu','Allen Liu, an assistant professor of mechanical engineering and biomedical engineering, discusses the possibilities of making artificial platelets from the ground up, and turning synthetic biology upside down in the process. Platelets, chronically in short supply at blood banks, are used in common treatments to replenish platelet levels in patients with cancer, heavy bleeding or certain autoimmune diseases. Injured soldiers might especially benefit.',NULL,NULL),
	(28,'http://24.media.tumblr.com/tumblr_mcijimnscB1qh3dpqo1_1280.jpg','http://24.media.tumblr.com/tumblr_mcijimnscB1qh3dpqo1_1280.jpg',NULL,NULL,NULL,NULL,NULL,'Tom Brady CoE Michigan Alumnus (?72)','Tom Brady, CoE Michigan Alumnus (\'72), speaks with members of EXO Dynamics LLC at the Fall 2012 TechArb Student Venture Showcase in Ann Arbor, MI on October 25, 2012.',NULL,NULL),
	(30,'http://25.media.tumblr.com/tumblr_m99jgmepRu1qh3dpqo1_r1_1280.jpg','http://25.media.tumblr.com/tumblr_m99jgmepRu1qh3dpqo1_r1_1280.jpg',NULL,NULL,NULL,NULL,NULL,'Michelle Walker','Merry Walker (BSE ME \'08, MSE ME \'09) is executive director and co-founder of Vort Port International (VPI), a company that was created on the U-M campus and now operates in Uganda, India and Madagascar with the mission of increasing the access that low-income communities have to basic resources through education, training and innovation of sustainable technology-based solutions. Here, she holds up a prototype of the bamboo bike that VPI is developing at Michigan Engineering\'s Walter E. Wilson Student Team Project Center.',NULL,NULL),
	(31,'http://farm8.staticflickr.com/7138/8164628717_d5a6760f7b_z.jpg','http://farm8.staticflickr.com/7138/8164628717_a8ac86d846_o.jpg',NULL,NULL,NULL,NULL,NULL,'Alec Halderman','Alec Halderman, an assistant professor in the Department of Electrical Engineering and Computer Science, is a renowned expert in computer security. Among his many breakthroughs is a radical new approach to thwarting Internet censorship. Working with researchers at U-M and the University of Waterloo in Canada, he developed Telex, a system that would essentially turn the whole web into a proxy server, making it virtually impossible for a censoring government to block individual sites.',NULL,NULL),
	(32,'http://engcomm.engin.umich.edu/difference/img/submissions/img_2931_sm.jpg','http://engcomm.engin.umich.edu/difference/img/submissions/img_2931.jpg','Kelley Maynard',NULL,NULL,NULL,NULL,'Kelley Maynard','I am working with a Vietnamese engineering firm that develops healthcare equipment to reduce neonatal morbidity and mortality in low-resource hospitals throughout Asia. In my multifunctional role, I help design, build, and test the equipment, as well as perform installations and training in partner hospitals. <br />\nThe picture shows me training clinicians in India on the use of our continuous positive air pressure (CPAP) device.',NULL,NULL),
	(33,'http://engcomm.engin.umich.edu/difference/img/submissions/neemo_16_day_7_a_1252722_sm.jpg','http://engcomm.engin.umich.edu/difference/img/submissions/neemo_16_day_7_a_1252722.jpg','Steve Chappell',NULL,NULL,NULL,NULL,'NEEMO','The NASA Extreme Environment Mission Operations (NEEMO) 16 mission took place in June 2012 and included Nuytco Deep Worker Submersibles. The submersibles simulated Multi-Mission Space Exploration Vehicles (MMSEVs) exploring an asteroid. Dr. Chappell is shown piloting one of the submersibles during the mission. Image credit goes to NASA/M. Widick.',NULL,NULL),
	(34,'http://engcomm.engin.umich.edu/difference/img/submissions/p1150079_sm.jpg','http://engcomm.engin.umich.edu/difference/img/submissions/p1150079.jpg','Steve Chappell',NULL,NULL,NULL,NULL,'NEEMO','The NASA Extreme Environment Mission Operations (NEEMO) 16 mission took place in June 2012 and included Nuytco Deep Worker Submersibles. The submersibles simulated Multi-Mission Space Exploration Vehicles (MMSEVs) exploring an asteroid. Dr. Chappell is shown piloting one of the submersibles during the mission. Image credit goes to NASA/M. Widick.',NULL,NULL),
	(35,'http://engcomm.engin.umich.edu/difference/img/submissions/p4200338_sm.jpg','http://engcomm.engin.umich.edu/difference/img/submissions/p4200338.jpg','Scott Ureel',NULL,NULL,NULL,NULL,'Scott Ureel','At close to 17,000 ft. in the Peruvian Andes, I was sent to perform a geological site investigation and drilling program for a mining opertation that will be imperative to the country of Peru. In these pictures, I was at the highest point on the mining property observing the surrounding landscape to understand the geology of the area.',NULL,NULL),
	(36,'http://engcomm.engin.umich.edu/difference/img/submissions/p4200321_sm.jpg','http://engcomm.engin.umich.edu/difference/img/submissions/p4200321.jpg','Scott Ureel',NULL,NULL,NULL,NULL,'Scott Ureel','At close to 17,000 ft. in the Peruvian Andes, I was sent to perform a geological site investigation and drilling program for a mining opertation that will be imperative to the country of Peru. In these pictures, I was at the highest point on the mining property observing the surrounding landscape to understand the geology of the area.',NULL,NULL),
	(37,'http://engcomm.engin.umich.edu/difference/img/submissions/p1090060_sm.jpg','http://engcomm.engin.umich.edu/difference/img/submissions/p1090060.jpg','Scott Ureel',NULL,NULL,NULL,NULL,'Scott Ureel','At close to 17,000 ft. in the Peruvian Andes, I was sent to perform a geological site investigation and drilling program for a mining opertation that will be imperative to the country of Peru. In these pictures, I was at the highest point on the mining property observing the surrounding landscape to understand the geology of the area.',NULL,NULL);
