	(1,'Aaron Stein','Kc0rrqiuMQM','Ann Arbor, MI','42.279384155376356','-83.73645904896239',0,NULL,NULL,NULL,NULL,1),
	(2,'Andrew Trumbo','Oktwa0ZGvbo','Troy, MI','42.607727743112825','-83.15126541492918',0,NULL,NULL,NULL,NULL,1),
	(3,'Anand Bharath','ISkLJTs6yCE','Chennai, India','13.074518893838118','80.25148269298097',0,NULL,NULL,NULL,NULL,1),
	(6,'David Munson','NJE4ES_F4NU','Iowa','41.95621454645726','-93.67376449940184',0,NULL,NULL,NULL,NULL,1),
	(7,'Ben Collins',NULL,'Ann Arbor, MI','42.28895613399538','-83.71443744239787',0,'When I was little, my family gave us one gift on Christmas Eve, and the rest of the gifts on Christmas morning.\n<br /><br />\nThe Christmas Eve gift was always pajamas.  It made sense when we were kids, but as we got older, our parents kept up the tradition for the sake of continuity, and possibly humor.  I still have a drawer full of PJ pants I never wear.',NULL,'6,','1,',1),
