	(19,'Parsa Zamashan','FOxA-aIH6aI','Iran','32.15793390427956','54.227274624133315',0,NULL,NULL,NULL,NULL,1),
	(21,'Hangcheng Lou','WxMIdBZ8_bI','Shanghai, China','30.964412334638446','121.37262221934816',0,NULL,NULL,NULL,NULL,1),
