VALUES
	(3,'Checklist of admissions tasks','img/pages/next-checklist.jpg','','next','next steps','<p>Your Admissions Checklist includes the list of task needed to enroll at Michigan Engineering. Click each box to check when complete.</p>                <form id=\"checklist\">                	<div><input class=\"styled\" id=\"c1\" type=\"checkbox\" name=\"step1\" value=\"1\" onclick=\"checkthis(\'c1\')\" checked=\"checked\" /><label for=\"c1\"></label><p><span class=\"steps\" id=\"c1p\">STEP ONE</span><br />Receive your acceptance letter and view admitted student website.</p></div>                	<div><input class=\"styled\" id=\"c2\" type=\"checkbox\" name=\"step2\" value=\"2\" onclick=\"checkthis(\'c2\')\"/><label for=\"c2\"></label><p><span class=\"steps\" id=\"c2p\">STEP TWO</span><br /><a href=\"\">Register for Campus Day</a>. This program is held January through April, and registration starts in January.</p></div>                	<div><input class=\"styled\" id=\"c3\" type=\"checkbox\" name=\"step3\" value=\"3\" onclick=\"checkthis(\'c3\')\"/><label for=\"c3\"></label><p><span class=\"steps\" id=\"c3p\">STEP THREE</span><br />Complete your <a href=\"\">CSS Profile and FAFSA</a>: The early deadline is February 15. April 30 is the final deadline.</p></div>                	<div><input class=\"styled\" id=\"c4\" type=\"checkbox\" name=\"step4\" value=\"4\" onclick=\"checkthis(\'c4\')\"/><label for=\"c4\"></label><p><span class=\"steps\" id=\"c4p\">STEP FOUR</span><br />Pay your $200 enrollment deposit. Deposit is due by May 1. Payment can be made via <a href=\"http://wolverineaccess.umich.edu/render.userLayoutRootNode.uP?uP_root=root&uP_sparam=activeTab&activeTab=2\">Wolverine Access</a>, or post marked by May 1, 2013. If paying by check, make payable to the University of Michigan College of Engineering and mail to 1000 University Ave, Suite 3A, Ann Arbor, MI 48108.</p></div>                	<div><input class=\"styled\" id=\"c5\" type=\"checkbox\" name=\"step5\" value=\"5\" onclick=\"checkthis(\'c5\')\"/><label for=\"c5\"></label><p><span class=\"steps\" id=\"c5p\">STEP FIVE</span><br />Check scholarship status. Admitted first-year students are automatically considered for <a href=\"http://www.engin.umich.edu/students/scholarships/newstudents\">College of Engineering merit-based scholarships</a>, and notification of awards are made before mid-April. <a href=\"http://www.finaid.umich.edu/Home/TypesofAid/ScholarshipsandGrants/OFAScholarshipListing.aspx\">U-M Scholarships</a> are administered by the Office of Financial Aid and most recipients are notified by April 15.</p></div>                	<div><input class=\"styled\" id=\"c6\" type=\"checkbox\" name=\"step6\" value=\"6\" onclick=\"checkthis(\'c6\')\"/><label for=\"c6\"></label><p><span class=\"steps\" id=\"c6p\">STEP SIX</span><br />Submit your <a href=\"http://housing.umich.edu/applications/freshman\">Housing/Michigan Learning Community Application</a>. Due by May 7.  If applying for a Michigan Learning Community, additional essays are required. Please verify the requirements for your selection. (Note: Enrollment Deposit must be paid)</p></div>                	<div><input class=\"styled\" id=\"c7\" type=\"checkbox\" name=\"step7\" value=\"7\" onclick=\"checkthis(\'c7\')\"/><label for=\"c7\"></label><p><span class=\"steps\" id=\"c7p\">STEP SEVEN</span><br /><a href=\"http://onsp.umich.edu/incoming_freshmen/orientation/\">Register for Orientation</a>. Registration slots made available in early April (Note: Enrollment Deposit must be paid)</p></div>                </form><script>load_checklist();</script>','',NULL,NULL),
	(4,'See students at their fav spots','img/pages/explore-favspots.jpg','','next','explore ann arbor','<iframe width=\"100%\" height=\"100%\" style=\"border:none;height:100%;\" src=\"http://www.engin.umich.edu/congrats/maplist.php\"></iframe>','',NULL,1),
	(11,'Register for campus day','img/pages/next-campusday.jpg','','next','next steps','<p>How can you know where you want to spend your college years without seeing it in person? <a href=\"http://www.admissions.umich.edu/drupal/campus-day-registration\">Campus Day</a> lets you get a glimpse of what Michigan Engineering has - and whether it?s right for you. You?ll have the opportunity to learn about life at the University, see the campus and Ann Arbor, visit departments, and interact with faculty.</p>\r\n \r\n<p><a href=\"http://www.admissions.umich.edu/drupal/campusday\">Register Now for Campus Day</a>:  This program is held January through April, and registration starts in January.</p>\r\n\r\n<p><ul>\r\n	<li>Campus Day 2013 Dates</li>\r\n	<li>Saturday, January 26</li>\r\n	<li>Monday, February 11</li>\r\n	<li>Saturday, February 16</li>\r\n	<li>Monday, February 18</li>\r\n	<li>Friday, February 22</li>\r\n	<li>Monday, March 11</li>\r\n	<li>Friday, March 15</li>\r\n	<li>Monday, March 18</li>\r\n	<li>Friday, March 22</li>\r\n	<li>Saturday, March 23</li>\r\n	<li>Monday, March 25</li>\r\n	<li>Friday, March 29</li>\r\n	<li>Monday, April 1</li>\r\n	<li>Friday, April 5</li>\r\n	<li>Monday, April 8</li>\r\n	<li>Friday, April 12</li>\r\n	<li>Saturday, April 13</li>\r\n	<li>Monday, April 15</li>\r\n	<li>Friday, April 19</li>\r\n	<li>Saturday, April 20</li>\r\n	<li>Monday, April 22</li>\r\n</ul></p>','',NULL,NULL),
	(13,'Put dates on your calendar','img/scroll/scroll1.png','','next','next steps','<p>Add these dates to your calendar!\n<ul>\n	<li><a href=\"http://www.google.com/calendar/feeds/umich.edu_mjfvqgl7p08g1rn6dfb6o1nchg%40group.calendar.google.com/public/basic\">XML</a></li>\n	<li><a href=\"http://www.google.com/calendar/ical/umich.edu_mjfvqgl7p08g1rn6dfb6o1nchg%40group.calendar.google.com/public/basic.ics\">iCal</a></li>\n	<li><a href=\"http://www.google.com/calendar/embed?src=umich.edu_mjfvqgl7p08g1rn6dfb6o1nchg%40group.calendar.google.com&ctz=America/New_York\">HTML</a></li>\n</ul>\n</p>\n\n\n<p>\n    <ul>\n        <li><b>January 1:</b> <a href=\"http://www.admissions.umich.edu/drupal/campusday\">Register for Campus Day</a></li>\n        <li><b>February 15:</b> <a href=\"#\">Financial Aid deadlines</a>: <a href=\"http://www.fafsa.ed.gov/\">FAFSA</a>  &amp; <a href=\"https://profileonline.collegeboard.org/prf/index.jsp\">CSS</a> early file deadline</li>\n        <li><b>March 15:</b> Don\'t forget - $200 Enrollment Deposit is due before you can register for orientation or apply for housing. Final deadline for deposit is May 1.</li>\n        <li><b>March 29:</b> <a href=\"http://www.admissions.umich.edu/drupal/campusday\">Register for Campus Day</a> If you haven\'t done this yet, you should do it now!</li>\n        <li><b>April 1:</b> <a href=\"http://onsp.umich.edu/incoming_freshmen/orientation/\">Register for Orientation</a> <span style=\"font-style: italic;\">(Note: May apply after enrollment deposit is made)</span>\n</li>\n        <li><b>April 15:</b> Scholarship status sent out on or before this date</li>\n        <li><b>April 30:</b> <a href=\"#\">Financial Aid deadlines</a>: <a href=\"http://www.fafsa.ed.gov/\">FAFSA</a>  &amp; <a href=\"https://profileonline.collegeboard.org/prf/index.jsp\">CSS</a> final file deadline</li>\n        <li><b>May 1:</b> $200 Enrollment Deposit due. Payment can be made via Wolverine Access, or post marked by May 1, 2013. If paying by check, make payable to the University of Michigan College of Engineering and mail to 1000 University Ave, Suite 3A, Ann Arbor, MI 48108.</li>\n        <li><b>May 7:</b> Deadline for <a href=\"http://housing.umich.edu/applications/freshman\">Housing/Michigan Learning Community Application</a>. If applying for a Michigan Learning Community, additional essays are required. <span style=\"font-style: italic;\">(Note: May apply after enrollment deposit is made)</span></li>\n        <li><b>May 10:</b> <a href=\"http://onsp.umich.edu/incoming_freshmen/orientation/\">Register for Orientation</a> if you haven\'t done this yet, you should do it now! <span style=\"font-style: italic;\">(Note: May apply after enrollment deposit is made)</span></li>\n    </ul>\n</p>','',NULL,NULL),
	(23,'A Sophomore in South Quad','img/pages/slice-cheriyan.jpg','','next','grab a slice','<p>Hannah Cheriyan knows first-hand the importance of medical advancements. As an infant her very life depended on it, and now she is determined to give back by following her passion for medical research - while still finding time for classes, music and fun.</p>\n<p><iframe width=\"280\" height=\"158\" src=\"http://www.youtube.com/embed/C20ZEjdOOiw\" frameborder=\"0\" allowfullscreen></iframe></p>','',NULL,NULL),
	(24,'Hybrids & Hockey','img/pages/slice-cheriyan.jpg','','next','grab a slice','<p>Need Content here</p>','',NULL,NULL),
	(25,'Jersey girl goes blue','img/pages/slice-cheriyan.jpg','','next','grab a slice','<p>Need Content here</p>','',NULL,NULL),
	(26,'Explore a map of North Campus','img/pages/explore-northcampus.jpg','','next','explore ann arbor','<p>North Campus is packed with classrooms, labs and facilities. See the buildings and areas that Michigan Engineering has to offer in this interactive map.<br /><a href=\"campusmap.php\">See the North Campus map</a></p>','',NULL,NULL),
	(27,'Watch video about A2\'s spirit','img/pages/explore-a2spirit.jpg','','next','explore ann arbor','<p>Ann Arbor is known as the quintessential college town, and it\'s full of its own quirky culture that students grow to love. This video captures the \"Spirit of Ann Arbor.\"<br /><br /><iframe width=\"280\" height=\"158\" src=\"http://www.youtube.com/embed/1HqrH2U1gmI\" frameborder=\"0\" allowfullscreen></iframe></p>','',NULL,NULL),
	(28,'#UMengin17','img/pages/pond-twitter.jpg','','next','connect','<p>See who else is considering being the class of 2017 - and share your excitement with them! Tweet with the hashtag #UMengin17. Don\'t have Twitter? <a href=\"mailto:UMengineering17@umich.edu\">Email us</a> and we\'ll do it for you!<br /><br /><a class=\"twitter-timeline\" href=\"https://twitter.com/search?q=%23fiscalcliff\" data-widget-id=\"276381492421214208\">Tweets about \"#fiscalcliff\"</a>\n<script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0];if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=\"//platform.twitter.com/widgets.js\";fjs.parentNode.insertBefore(js,fjs);}}(document,\"script\",\"twitter-wjs\");</script>','',NULL,NULL),
	(29,'What\'s up on Facebook','img/pages/pond-facebook.jpg','','next','connect','<iframe src=\"http://www.facebook.com/plugins/likebox.php?id=51664048323&amp;width=272&amp;connections=8&amp;stream=true&amp;header=false&amp;\" scrolling=\"no\" frameborder=\"0\" style=\"border:none; overflow:hidden;\" allowTransparency=\"true\"></iframe>','',NULL,NULL),
	(30,'Email us','img/pages/pond-emailus.jpg','','next','connect','<p>You have questions, and we have answers. Here are some people you may want to know:</p>\n\n<p><b>Admissions Information</b><br />\nKatrina Williams<br />\nAs Director of Recruitment & Admissions, Katrina can answer any questions you have about the admissions process - including dates, deadlines, forms and more.<br />\n<a href=\"mailto:katwill@umich.edu?cc=bencollins2@gmail.com&amp;subject=Admissions question&amp;\">katwill@umich.edu</a></p>\n\n<p><b>College and University Information</b><br />\nJeanne Murabito<br />\nIf you (or your family) are wondering what the campus, classes or programs are like, Jeanne, the Executive Director of Student Affairs, can give you the skinny.<br />\n<a href=\"mailto:murabito@umich.edu\">murabito@umich.edu</a></p>\n\n<p><b>Campus Visits</b><br />\nDavid Betts<br />\nIf you\'d like one more look at the college before you commit, David (our Campus Visit Coordinator) can get you hooked up.<br />\n<a href=\"mailto:djmbetts@umich.edu\">djmbetts@umich.edu</a></p>\n\n<p><b>Scholarships</b><br />\nGeorge Dendrinos<br />\nIf you\'re trying to navigate the world of financial aid or are wondering what scholarships may be available for you, our Scholarship Manager George has you covered.<br />\n<a href=\"mailto:coe.scholarships@umich.edu\">coe.scholarships@umich.edu</a></p>\n\n<p><b>Student Life</b><br />\nJennifer Wegner<br />\nJen is Assistant Director of Student Affairs, which is a fancy way of saying that she knows everything there is to know about what it\'s like to be a student at Michigan Engineering.<br />\n<a href=\"mailto:jwegner@umich.edu\">jwegner@umich.edu</a></p>','',NULL,NULL);
